Aunts Aren't Gentlemen [Abridged By Richard Hamilton]

Blake Ritson reads a classic Jeeves and Wooster story from PG Wodehouse

A Typical Man about Town

1/5 Man-about-town Bertie Wooster has been rather overdoing London highlife.
FIRST BROADCAST: 16 Dec 2013 

The Quiet, Martini-less Life

2/5 On doctor's orders, man-about-town Wooster is forced to sample the rural martini-less life
FIRST BROADCAST: 17 Dec 2013

Has He Brought It Yet?

3/5 Star-crossed lovers and a disappearing cat tempt Bertie away from the martini-less life.
FIRST BROADCAST: 18 Dec 2013

I Can Explain Everything

4/5 Bertie finds himself unexpectedly betrothed, and in receipt of a missing cat.
FIRST BROADCAST: 19 Dec 2013

Trying to Brazen It Out

5/5 An elopement is in the offing, but will Jeeves, as always, save Bertie's bacon?
FIRST BROADCAST: 20 Dec 2013

